import React, { useState, useEffect } from "react";

const Health = () => {
  const [items, setItems] = useState([]);

  useEffect(() => {
    return () => {
      const addItem = item => {
        items.push(item);
        setItems(items);
      };
    };
  }, []);

  return <h1>Health</h1>;
  <button onClick={addItem("this")} />;
};

export default Health;
